{"command": "node -e "
const { ethers } = require('ethers');
const provider = new ethers.JsonRpcProvider('https://mainnet.base.org');
const daimon = new ethers.Contract(
  '0x98c51C8E958ccCD37F798b2B9332d148E2c05D57',
  ['event Transfer(address indexed from, address indexed to, uint256 value)'],
  provider
);

async function getRecentTransfers() {
  const currentBlock = await provider.getBlockNumber();
  const events = await daimon.queryFilter(
    daimon.filters.Transfer(),
    currentBlock - 5000, // ~17 hours
    'latest'
  );

  // Filter out mints (from = 0x0) and burns (to = 0x0)
  const transfers = events.filter(e => 
    e.args.from !== '0x0000000000000000000000000000000000000000' &&
    e.args.to !== '0x0000000000000000000000000000000000000000'
  );

  console.log('Recent transfers (last ~17h):', transfers.length);

  // Get unique addresses
  const unique = new Set();
  transfers.forEach(e => {
    unique.add(e.args.from);
    unique.add(e.args.to);
  });
  console.log('Unique addresses involved:', unique.size);

  // Show last 5
  console.log('\\nLast 5 transfers:');
  for (let i = Math.max(0, transfers.length - 5); i < transfers.length; i++) {
    const e = transfers[i];
    const amount = ethers.formatUnits(e.args.value, 18);
    console.log(\`\${amount.slice(0, 10)}... DAIMON from \${e.args.from.slice(0,8)}... to \${e.args.to.slice(0,8)}...\`);
  }
}
getRecentTransfers();
""}
